import React from "react";
import sunny from '../Images/sunny.png';
import cloudy from '../Images/cloudy.jpeg';
import rainy from '../Images/rainy.png';
import './WeatherDay.css';

const WeatherDay = (props) => {
    const weatherDetails = props.weatherInfoData;
    console.log(weatherDetails + "from weather day");
    return (
        <div className="weatherDayWrapper">
            {weatherDetails.map((weather) => {
                return (
                    <div className="renderedWeatherDayWrapper">
                        <div className="weatherDateandDay">{weather.day}</div>
                        <div className="weatherDegress">{weather.degrees} degrees</div>
                        <div className="weatherDayImage">
                            {weather.status == "sunny" ? <img id="weatherDayImage" src={sunny} alt="weatherDayImage" /> :
                                weather.status == "cloudy" ? <img id="weatherDayImage" src={cloudy} alt="weatherDayImage" /> :
                                    weather.status == "rainy" ? <img id="weatherDayImage" src={rainy} alt="weatherDayImage" /> : <p>Error</p>
                            }

                        </div>
                    </div>
                );
            })}
        </div>
    );
}

export default WeatherDay;
